import React from 'react';

const ToDo = ({ task, handleCheckboxChange, handleTodoClick, handleDelete, handleEditClick, isDeleteMode, onDateChange, isTodayCategory }) => {
  return (
    <div className="todo-item">
      <input
        type="checkbox"
        checked={task.completed}
        onChange={() => handleCheckboxChange(task.taskId)}
        disabled={isDeleteMode}
      />
      <label onClick={(e) => handleTodoClick(task, e)}>
        {task.title}
      </label>
      <button onClick={() => handleEditClick(task)}>Edit</button>
      <button onClick={() => handleDelete(task.taskId)}>Delete</button>
      {task.selected && <span className="selected-indicator">Selected</span>}
      {/* Additional UI elements */}
    </div>
  );
};

export default ToDo;
